# In[1]: imports
import json
import boto3

# In[2]: your SageMaker endpoint
endpoint_name = "llama-3-2-vision-from-sagemaker-15th-try"  # ‚Üê change this

# In[3]: your blank-image Data-URL (from your code)
blank_png = (
    "data:image/png;base64,"
    ""
)

# In[4]: build the payload list-of-dicts
messages = [
    # 1) blank starter image
    {
        "role": "user",
        "content": [
            {"type": "image_url", "image_url": {"url": blank_png}},
            {"type": "text",      "text": "ignore this blank image"}
        ]
    },
    # 2) simple text query
    {
        "role": "Assistant",
        "content": [
            {"type": "text", "text": ""}
        ]
    },
    # 3) pretend assistant reply
    {
        "role": "user",
        "content": [
            {"type": "text", "text": "Hello my name is zain"}
        ]
    },
    #  {
    #     "role": "Assistant",
    #     "content": [
    #         {"type": "text", "text": "Hello Zain, it's nice to meet you. How can I assist you today?"}
    #     ]
    # },
    # {
    #     "role": "user",
    #     "content": [
    #         {"type": "image_url", "image_url": {"url": "data:image/jpeg;base64,"}},
    #         {"type": "text",      "text": "What is this image"}
    #     ]
    # },
]

payload = json.dumps(messages)

# In[5]: invoke your endpoint
client = boto3.client("sagemaker-runtime", region_name="us-east-1")
resp = client.invoke_endpoint(
    EndpointName=endpoint_name,
    ContentType="application/json",
    Body=payload
)

# In[6]: parse and print
result = json.loads(resp["Body"].read().decode("utf-8"))
print(json.dumps(result, indent=2))
